import React, {useState, useEffect} from 'react';
import './App.css';
import GetData from './services/GetData.js';
import Gif from './components/Gif.js'

function App () {
  const [gifs, setGifs] = useState([]);

  useEffect(function () {
    GetData({keyword: 'perro'})
      .then(gifs => setGifs(gifs))
  }, []);

  return (
    <div className="App">
      <div className="container">
        <div className="row">
        {
            gifs.map(singleGif => {
              return <Gif key={singleGif.id} {...singleGif} />
            })
        }
        </div>
      </div>
    </div>
  )
}

export default App;
